import React from 'react';

import { Icon } from '../components/theme/themeStyles';
import Theme from '../components/theme/theme';

import mountainSound from '../sounds/concentration.mp3';
import MountainIcon from '../images/mountain-2.png';

function Mountain(props) {
  return (
    <Theme>
      <Icon src={MountainIcon} bigMountain />
      <Icon src={MountainIcon} smallMountain />

      <audio class="music">
        <source src={mountainSound} />
      </audio>
    </Theme>
  );
}

export default Mountain;
